import React,  {Component} from 'react'

export default class extends Component {
  static getInitialProps = async function() {

    const res = await fetch('https://www.food2fork.com/api/search?key=bd445cddd5ba728785e1372eb2c156e7')
    const data = await res.json()

    return {
      item: data
    }
  }

  render() {
    return <>
      <h1>Hello World</h1>
    </>
  }


}
